// frontend/src/components/Layout/Menu.js
import React from 'react';
import { useNavigate } from 'react-router-dom';
import './Menu.css'; // Asegúrate de crear este archivo para estilos personalizados

const Menu = () => {
  const navigate = useNavigate();

  return (
    <div className="menu-container">
      <h1>Menú Principal</h1>
      <div className="button-container">
        <button onClick={() => navigate('/documents')} className="menu-button">Documentos</button>
        <button onClick={() => navigate('/transactions')} className="menu-button">Transacciones</button>
      </div>
    </div>
  );
};

export default Menu;
